import React, { Component } from 'react'

export default class CreateOrder extends Component {
    state = {
        cart: null,
        totalPrice: null
    }
    componentDidMount() {
        this.setState({
            cart: this.props.cart,
            totalPrice: this.state.totalPrice
        })
    }
    render() {
        return (
            <div>
                {
                    this.state.cart && this.state.totalPrice && (
                        <h1>{this.state.cart}</h1>
                    )
                }
            </div>
        )
    }
}
